import React, { useState, useCallback } from 'react';
import { Knob } from 'react-rotary-knob';
import * as skins from 'react-rotary-knob-skin-pack';

const WebSynth = () => {
  const [audioContext, setAudioContext] = useState(null);
  const [oscillator, setOscillator] = useState(null);
  const [gainNode, setGainNode] = useState(null);
  const [filterNode, setFilterNode] = useState(null);
  const [isPlaying, setIsPlaying] = useState(false);
  const [frequency, setFrequency] = useState(440);
  const [filterFrequency, setFilterFrequency] = useState(1000);
  const [waveform, setWaveform] = useState('sine');

  // ... (前回のコードと同じなので省略: setupAudio, handlePlayStop, handleFrequencyChange, handleFilterChange, handleWaveformChange)

  const renderKey = useCallback((note, freq, isSharp = false) => (
    <button
      className={`${isSharp ? 'w-8 h-24 bg-gray-800 text-white -mx-4 z-10' : 'w-12 h-32 bg-white text-gray-800'} 
                  font-bold rounded-b-lg focus:outline-none transition-all duration-150 ease-in-out 
                  transform hover:scale-105 active:scale-95 shadow-md relative`}
      onMouseDown={() => {
        if (!audioContext) setupAudio();
        handleFrequencyChange(freq);
        if (!isPlaying) handlePlayStop();
      }}
      onMouseUp={() => {
        if (isPlaying) handlePlayStop();
      }}
    >
      {note}
    </button>
  ), [audioContext, setupAudio, handleFrequencyChange, isPlaying, handlePlayStop]);

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100">
      <div className="p-8 bg-orange-500 rounded-3xl shadow-2xl w-[480px] font-sans">
        <div className="bg-gray-900 p-6 rounded-2xl mb-6">
          <div className="bg-green-300 h-24 rounded-lg flex items-center justify-center text-3xl font-mono text-gray-800 shadow-inner">
            {isPlaying ? 'Playing' : 'Stopped'} - {waveform}
            <br />
            {Math.round(frequency)}Hz
          </div>
        </div>
        <div className="grid grid-cols-4 gap-6 mb-6">
          <div className="flex flex-col items-center">
            <Knob
              value={frequency}
              onChange={handleFrequencyChange}
              min={20}
              max={2000}
              unlockDistance={0}
              preciseMode={false}
              skin={skins.s12}
              style={{ width: '70px', height: '70px' }}
            />
            <span className="mt-2 text-xs text-white font-semibold">FREQUENCY</span>
          </div>
          <div className="flex flex-col items-center">
            <Knob
              value={filterFrequency}
              onChange={handleFilterChange}
              min={20}
              max={20000}
              unlockDistance={0}
              preciseMode={false}
              skin={skins.s12}
              style={{ width: '70px', height: '70px' }}
            />
            <span className="mt-2 text-xs text-white font-semibold">FILTER</span>
          </div>
          <div className="flex flex-col items-center justify-center">
            <button
              className="bg-blue-500 text-white w-16 h-16 rounded-full focus:outline-none transition-all duration-150 ease-in-out transform hover:scale-105 active:scale-95 shadow-md text-lg font-bold"
              onClick={handlePlayStop}
            >
              {isPlaying ? 'Stop' : 'Play'}
            </button>
          </div>
          <div className="flex flex-col items-center justify-center">
            <select
              className="bg-gray-200 text-gray-800 px-4 py-2 rounded-full focus:outline-none shadow-md text-sm"
              value={waveform}
              onChange={(e) => handleWaveformChange(e.target.value)}
            >
              <option value="sine">Sine</option>
              <option value="square">Square</option>
              <option value="sawtooth">Sawtooth</option>
              <option value="triangle">Triangle</option>
            </select>
          </div>
        </div>
        <div className="relative h-48 flex justify-center">
          <div className="absolute flex">
            {renderKey('C', 261.63)}
            {renderKey('C#', 277.18, true)}
            {renderKey('D', 293.66)}
            {renderKey('D#', 311.13, true)}
            {renderKey('E', 329.63)}
            {renderKey('F', 349.23)}
            {renderKey('F#', 369.99, true)}
            {renderKey('G', 392.00)}
            {renderKey('G#', 415.30, true)}
            {renderKey('A', 440.00)}
            {renderKey('A#', 466.16, true)}
            {renderKey('B', 493.88)}
          </div>
        </div>
      </div>
    </div>
  );
};

export default WebSynth;
